import { CometChatMessageOptions } from "./CometChatMessageOptions";

const CometChatCustomMessageOptions = Object.freeze({
	delete: CometChatMessageOptions.delete,
	replyInPrivate: CometChatMessageOptions.replyInPrivate,
	reactToMessage: CometChatMessageOptions.reactToMessage,
});

export { CometChatCustomMessageOptions };
